package main
import (
  "bytes"
  "compress/gzip"
  "encoding/base64"
  "io"
  "github.com/computeportal/glui"
)
const (
  breugel_data =""
)
var breugel = &glui.ImageData{nil, 931, 700}
func load_breugel() bool {
  b, err := base64.StdEncoding.DecodeString(breugel_data)
  if err != nil {panic(err)}
  r, err := gzip.NewReader(bytes.NewBuffer(b))
  if err != nil {panic(err)}
  c := &bytes.Buffer{}
  io.Copy(c, r)
  breugel.Pix = c.Bytes()
  return true
}
var breugel_loaded = load_breugel()